import styled from 'styled-components';

const HeadlineBlock = styled.div`
  padding-top: 48px;
  padding-left: 32px;
  padding-right: 32px;
  padding-bottom: 24px;
  border-bottom: 1px solid #e9ecef;
  h1 {
    margin: 0;
    font-size: 36px;
    color: #343a40;
  }
  .item {
    margin-top: 4px;
    color: #868e96;
    font-size: 21px;
  }
`;

function Headline() {
  const todos = useTodoState();
  console.log(todos);
  return (
    <HeadlineBlock>
      <h1>3일 뒤,</h1>
      <div className="item">나이키 조던 1 유니버시티 블루가 발매됩니다.</div>
    </HeadlineBlock>
  );
}

export default Headline;
